using CoreServicesApp.Services;
using CoreServicesApp.Utils;
using DataAccess.Helpers;
using ExternalServiceApp.Services;
using Microsoft.AspNetCore.Mvc;

namespace ApiDemoChicote.Controllers
{
    [ApiController]
    [Route("Cotizacion")]
    public class CotizacionController : ControllerBase
    {
        private readonly CotizacionServices _CotizacionServices;
        private readonly LogUtils _logUtils;
        private readonly EmailService _EmailService;
        public CotizacionController(CotizacionServices cotizacionServices, LogUtils logUtils, EmailService emailService)
        {
            _CotizacionServices = cotizacionServices;
            _logUtils = logUtils;
            _EmailService = emailService;
        }


        [HttpGet]
        [Route("getCotizacion")]
        public async Task<IActionResult> getCotizacion(string idCotizacion)
        {
            Response res = new Response { status = Constants.Error_Status };
            try
            {
                res = await _CotizacionServices.getCotizacion(idCotizacion);
                if (res.status.Equals(Constants.Error_Status))
                {
                    DataLog log = new DataLog
                    {
                        user = "Cotizacion",
                        action = Constants.GET,
                        service = "Cotizacion/GetCotizacion",
                        innerExeption = res.message,
                        description = res.data.ToString(),
                        priority = Constants.Error
                    };
                    _logUtils.SaveLogAsync(log);
                    _EmailService.SendEmail(log);
                    string archive = "";
                    _EmailService.SendEmailInvoiceBack(archive, "francisco.ramirez@calzadochicote.com,cristhian.pineda@calzadochicote.com,antonio.mejia@calzadochicote.com",
                        "Este es un ejemplo de envio de archivo", "OV-PRUEBA");
                }
            }
            catch (Exception ex)
            {
                res.message = ex.Message;
                res.data = ex.InnerException.Message == null ? ex.Message : ex.InnerException.Message;
            }
            return Ok(res);
        }
    }
}
